import { useState, React } from 'react';
import './LaunchingSoon.scss';
import Plx from 'react-plx';

import InstagramIcon from '@mui/icons-material/Instagram';
import FacebookIcon from "@mui/icons-material/Facebook";
import TwitterIcon from '@mui/icons-material/Twitter';
import KeyboardDoubleArrowDownIcon from '@mui/icons-material/KeyboardDoubleArrowDown';
import zIndex from '@mui/material/styles/zIndex';
import { display } from '@mui/system';


const LaunchingSoon = () => {

    const [name, setName] = useState('');
    const [email, setEmail] = useState('');

  return (
    <div className='launchingSoon'>

        <div className="plx">
            <Plx
                parallaxData={[
                {
                    start: 0,
                    end: 700,
                    // duration: 800,
                    easing: "ease-in",
                    properties: [
                    {
                        startValue: 1,
                        endValue: 5,
                        property: "scale"
                    }
                    ]
                }
                ]}
                style={{
                position: "fixed",
                left: 0,
                top: 0,
                width: "100%",
                }}
            >
                <img style={{overflow: "hidden", width: "100%", height: "100vh"}} src="/img/border-gradient.png" alt="foreground" />
            </Plx>

            <Plx
                parallaxData={[
                {
                    start: 0,
                    end: 800,
                    properties: [
                    {
                        startValue: 1,
                        endValue: 1.15,
                        property: "scale"
                    }
                    ]
                }
                ]}
                style={{  
                position: "fixed",
                left: 0,
                top: 0,
                width: "100%",
                }}
            >
                <img style={{zIndex: "-1", width: "100%", height: "100vh"}} src="/img/MillionDollarPosters-gradient.png" alt="background" />

            </Plx>

            <Plx
                parallaxData={[
                {
                    start: 0,
                    end: 400,
                    properties: [
                    {
                        startValue: 1,
                        endValue: 0,
                        property: "opacity"
                    },
                    {
                        startValue: 0,
                        endValue: 100,
                        property: "translateY"
                    }]
                }
                ]}
                style={{
                position: "fixed",
                left: 0,
                top: "40%",
                width: "100%"
                }}
            >

                <h1 className='milliondollarposters'>
                    MillionDollarPosters
                </h1>

                <p className='copyright'>© Copyright 2023. All Rights Reserved</p>

                <p className='scroll'>
                    scroll down
                </p>

                <KeyboardDoubleArrowDownIcon style={{color: "white", marginTop: "10px", fontSize: "15px"}}/>

            </Plx>

            <Plx
                parallaxData={[
                {
                    start: 0,
                    end: 400,
                    properties: [
                    {
                        startValue: 0,
                        endValue: 1,
                        property: "opacity"
                    },
                    ]
                },
                {
                    start: 800,
                    end: 1200,
                    properties: [
                        {
                            startValue: 1,
                            endValue: 0,
                            property: "opacity"
                        },
                        {
                            startValue: 0,
                            endValue: 100,
                            property: "translateY"
                        },
                    ]
                }
                ]}
                style={{
                position: "fixed",
                left: 0,
                top: "40%",
                width: "100%"
                }}
            >

                <h1 className='launch'>
                    Launching Soon.
                </h1>

                <p className='scroll'>
                    scroll down
                </p>

                <KeyboardDoubleArrowDownIcon style={{color: "white", marginTop: "10px", fontSize: "15px"}}/>

            </Plx> 

            <Plx
                parallaxData={[
                    {
                        start: 0,
                        end: 800,
                        properties: [
                        {
                            startValue: 0,
                            endValue: 0,
                            property: "opacity",
                        },
                        ]
                    },
                    {
                        start: 800,
                        end: 1200,
                        properties: [
                        {
                            startValue: 0,
                            endValue: 1,
                            property: "opacity",
                        },
                        ]
                    },
                ]}
                style={{
                    position: "fixed",
                    alignItems: "center",
                    justifyContent: "center",
                    textAlign: "center",
                    top: "35%",
                    width: "100%",
                    }}
            >

                <div className="newsletter">
                    <h1 className='newsletterH1'>Our Newsletter</h1>

                    <input type="text" className="nameInput" placeholder="Your Name" value={name} onInput={e => setName(e.target.value)}/>
                    <br/>
                    <input type="text" className="emailInput" placeholder="Your Email" value={email} onInput={e => setEmail(e.target.value)}/>
                    <br/>
                    <button className="btn">Send</button>
                    <br/>
                </div>

                <div className="social">
                    <a target="_blank" href="https://www.instagram.com/milliondollarposters/"><InstagramIcon/></a>
                    <a href=""><FacebookIcon/></a>
                    <a href=""><TwitterIcon/></a>
                </div> 

            </Plx>
        </div>

    </div>
  )
}

export default LaunchingSoon
